import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles.css'; // Ensure you have this import to apply styles

const TreeView = () => {
  const [godowns, setGodowns] = useState([]);
  const [items, setItems] = useState([]);
  const [selectedItem, setSelectedItem] = useState(null);
  const [expandedGodowns, setExpandedGodowns] = useState({});

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/godowns/')
      .then(response => {
        setGodowns(response.data);
      })
      .catch(error => {
        console.error("There was an error fetching the godowns!", error);
      });
  }, []);

  const handleExpand = (godownId) => {
    setExpandedGodowns(prev => ({
      ...prev,
      [godownId]: !prev[godownId]
    }));

    // Fetch items only when expanding
    if (!expandedGodowns[godownId]) {
      axios.get(`http://127.0.0.1:8000/api/items/?godown_id=${godownId}`)
        .then(response => {
          setItems(prevItems => ([...prevItems, ...response.data]));
        })
        .catch(error => {
          console.error("There was an error fetching the items!", error);
        });
    }
  };

  const handleItemClick = (item) => {
    setSelectedItem(item);
  };

  const renderTree = (locations) => {
    return locations.map(location => (
      <li key={location.id}>
        <div className="godown-button" onClick={() => handleExpand(location.id)}>
          {location.name}
          <button className="expand-button">
            {expandedGodowns[location.id] ? '-' : '+'}
          </button>
        </div>
        {expandedGodowns[location.id] && (
          <ul>
            {items
              .filter(item => item.godown === location.id)
              .map(item => (
                <li key={item.item_id}>
                  <button className="item-button" onClick={() => handleItemClick(item)}>
                    {item.name}
                  </button>
                </li>
              ))}
          </ul>
        )}
      </li>
    ));
  };

  return (
    <div className="tree-view-container">
      <div className="sidebar">
        <h2>Godowns</h2>
        <ul>
          {godowns.filter(godown => godown.parent_godown === null).map(godown => (
            <li key={godown.id}>
              <div className="godown-button" onClick={() => handleExpand(godown.id)}>
                {godown.name}
                <button className="expand-button">
                  {expandedGodowns[godown.id] ? '-' : '+'}
                </button>
              </div>
              {expandedGodowns[godown.id] && (
                <ul>
                  {godowns.filter(sub => sub.parent_godown === godown.id).map(subGodown => (
                    <li key={subGodown.id}>
                      <div className="godown-button" onClick={() => handleExpand(subGodown.id)}>
                        {subGodown.name}
                        <button className="expand-button">
                          {expandedGodowns[subGodown.id] ? '-' : '+'}
                        </button>
                      </div>
                      {expandedGodowns[subGodown.id] && (
                        <ul>
                          {items.filter(item => item.godown === subGodown.id).map(item => (
                            <li key={item.item_id}>
                              <button className="item-button" onClick={() => handleItemClick(item)}>
                                {item.name}
                              </button>
                            </li>
                          ))}
                        </ul>
                      )}
                    </li>
                  ))}
                </ul>
              )}
            </li>
          ))}
        </ul>
      </div>
      <div className="main-content">
        {selectedItem && (
          <div className="item-details">
            <h3>{selectedItem.name}</h3>
            <p><strong>Quantity:</strong> {selectedItem.quantity}</p>
            <p><strong>Category:</strong> {selectedItem.category}</p>
            <p><strong>Price:</strong> ${selectedItem.price.toFixed(2)}</p>
            <p><strong>Status:</strong> {selectedItem.status}</p>
            <p><strong>Godown:</strong> {selectedItem.godown}</p>
            <p><strong>Brand:</strong> {selectedItem.brand}</p>
            <p><strong>Attributes:</strong></p>
            <ul>
              <li><strong>Type:</strong> {selectedItem.attributes.type}</li>
              <li><strong>Material:</strong> {selectedItem.attributes.material}</li>
              <li><strong>Warranty Years:</strong> {selectedItem.attributes.warranty_years}</li>
            </ul>
            <img src={selectedItem.image_url} alt={selectedItem.name} />
          </div>
        )}
      </div>
    </div>
  );
};

export default TreeView;
